description:
@-moz-document url-prefix("https://www.youtube.com/") {
    /* Grey background */
    body {
        background-color: #f1f1f1 !important;
    }
 
    /* Grey video player */
    .html5-video-container, .video-stream {
        background-color: #999 !important;
    }
}

